I'm Aussie which means its Father's Day tomorrow, and I approach this post a little hesitantly. Some of us miss the relationships that were or could have been. But if you are blessed by the presence of a saved father and you're searching for words to express appreciation,¬†then I have an idea for you.

Few things are as personal and grounded as sharing a memory. Memories aren't just about stuff that happened, they can form US. And when, by God's grace, these memories are good, I think sharing them brings strength to the heart, particularly for Christian parents. They labor long and hard in love and prayer for their kids.

So this afternoon, create a little space for reflection (perhaps with a snack and an iced tea) and have a reminisce. And if you're wondering how to get that memory on paper, here's a little guide:

‚óá Share a memory. What was it and what do you remember seeing, feeling?
‚óá Link to your dad. What do you learn about your dad's¬†character / personality from this memory?
‚óá Describe the value. Has the memory impacted you? Either then or now?
‚óá Express gratitude. What do you thank God for (and in Him, your dad)?

It could look a little like this: 

‚úç Dear Dad

Happy Father's Day!

I was thinking today about how we used to get together with the Jones family for random basketball games. Those memories have really stayed with me... us kids scrambling around the court yelling and how silly I felt running after the ball when I missed it!

You've always been so good at making time to hang out, play and catch up with friends. It's helped me learn what's important. I know I can get so distracted with being busy. I'm really glad God's been teaching me that through you... thank you.

Love you. ‚úç

